import './App.css';
import NavBar from './Components/NavBar';
import Home from './Components/Home';
import About from './Components/About';
import {Switch, Route} from 'react-router-dom';


function App() {
  return (
    <div>
      <NavBar />
      <Switch>
        <Route path = "/" exact>
          <Home />
        </Route>
        <Route path = "/about" component = {About}>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
